import React from "react";
import "./navbar.css";
import logo from "../../assets/catcomputer.jpg";

const Navbar = () => {
  return (
    <nav className="navbar">
      <img src={catlogo} alt="logo" />
      <div className="desktopMenu">
        <link to="/" className="desktopMenuLinkItem">Home</link>
        <link to="/" className="desktopMenuLinkItem">Clients</link>
        <link to="/" className="desktopMenuLinkItem">Abbout</link>
        <link to="/" className="desktopMenuLinkItem">Portfolio</link> 

      </div>
      <button className="desktopMenuBtn">
        <img src="" alt="" className="desktopMenuImg" />
        Contact Me
      </button>
    </nav>
  );
};

export default Navbar;
